export default {
  name: 'response-status',
  props: {
    statusCode: {
      type: Number
    },
    responseTime: {
      type: Number
    },
    message: {
      type: String
    }
  },
  data() {
    return {
    }
  },
  methods: {
    getStatusCss(val) {
      if (!val) {
        return
      }
      if (String(val).startsWith('2')) {
        return 'success'
      }
      if (String(val).startsWith('3')) {
        return 'warning'
      }
      return 'error'
    },
    getTimeCss(val) {
      if (!val) {
        return
      }
      if (val <= 2000) {
        return 'success'
      }
      if (val > 2000 && val <= 5000) {
        return 'warning'
      }
      return 'error'
    }
  }
}
